import React from "react";
import { Link } from "react-router-dom";

export default function ForgotPassword() {
  return (
    <>
      <div className="h-screen flex items-center justify-center flex-col  bg-gradient-to-r from-pink-100 via-purple-100 to-gray-100 w-full h-screen font-abel">
        <div className="w-[600px] h-[600px] flex items-center justify-center flex-col">
          <div className="w-full">Forgot your password?</div>
          <div>Please enter your phone number to sign in NU event.</div>
          <input />
          <button>Request password reset</button>
          <div>
            Already have an accound? <Link to="/sign-in">Sign In</Link>
          </div>
        </div>
      </div>
    </>
  );
}
